import React, { Component } from "react";

class LoadingContent extends Component {
  constructor(props) {
    super(props);
    this.state = { loading: this.props.loading };
  }
  render() {
    if (this.state.loading) {
      return <p>Loading Requested Menu...</p>;
    } else {
      return <p />;
    }
  }
}

export default LoadingContent;
